import { z } from 'zod';

export const srFormSchema = z.object({
  firstName: z.string().min(1, 'First name is required'),
  lastName: z.string().min(1, 'Last name is required'),
  email: z.string().email('Invalid email address'),
  phoneNumber: z
    .string()
    .regex(/^(\+964|964|0)?7[3-9]\d{8}$/, {
      message: 'Please enter a valid Iraq phone number',
    })
    .transform((value) => {
      if (value.startsWith('0')) return '+964' + value.slice(1);
      if (value.startsWith('964')) return '+' + value;
      if (!value.startsWith('+')) return '+964' + value;
      return value;
    }),
  dateOfBirth: z
    .date()
    .nullable()
    .refine((date) => date, {
      message: 'Date of birth is required',
    }),
  gender: z.enum(['male', 'female', 'other']),
  photo: z.any().refine((file) => file, {
    message: 'User image is required',
  }),
  countryId: z.string().min(1, 'Country is required'),
  cityId: z.string().min(1, 'City is required'),
  areaId: z.string().min(1, 'Area is required'),
  addressLine: z.string().min(1, 'Address is required'),
  level: z.string().min(1, 'Level is required'),
  verificationType: z.string().min(1, 'Verification type is required'),
  verificationDocument: z.any().refine((file) => file, {
    message: 'Verification document is required',
  }),
  issueDate: z
    .date()
    .nullable()
    .refine((date) => date, {
      message: 'Issue date is required',
    }),
  expireDate: z
    .date()
    .nullable()
    .refine((date) => date, {
      message: 'Expire date is required',
    }),
  distributorId: z.string().min(1, 'Distributor is required'),
  subDistributorId: z.string().min(1, 'Sub distributor is required'),
  status: z.enum(['active', 'inactive']),
  checkerId: z.string().nullable(),
  remarks: z.string().optional(),
});

export type SRFormValues = z.infer<typeof srFormSchema>;

export interface SR {
  userId: string;
  firstName: string;
  lastName: string;
  emailAddress: string;
  mobileNumber: string;
  dateOfBirth: string;
  gender: 'male' | 'female' | 'other';
  userImage?: string;
  country: string;
  city: string;
  area: string;
  address: string;
  level: string;
  verificationType: string;
  verificationDocument?: string;
  issueDate: string;
  expireDate: string;
  status: boolean;
  subDistributorId: string;
  subDistributorName: string;
  checkerId: string | null;
  checkerName: string | null;
  remarks?: string;
  createdAt: string;
  updatedAt: string | null;
}

export interface ISRResponse {
  distributors: SR[];
}

export interface ISRPayload {
  phoneNumber: string;
  email: string;
  firstName: string;
  lastName: string;
  gender: 'male' | 'female' | 'other';
  dateOfBirth: string;
  level: string;
  countryId: string;
  areaId: string;
  cityId: string;
  addressLine: string;
  photo?: string;
  verificationType: number;
  verificationDocument?: string;
  remarks?: string;
  issueDate: string;
  expireDate: string;
  distributorId: string;
  subDistributorId: string;
  status: boolean;
  checkerId: string | null;
}

export interface ICheckerResponse {
  checkerList: Array<{
    id: number;
    userId: string;
    name: string;
  }>;
}

export interface ICountryResponse {
  data: {
    countryList: Array<{
      id: string;
      countryName: string;
      code: string;
    }>;
  };
}

export interface ICityResponse {
  data: {
    cityList: Array<{
      id: string;
      cityName: string;
      code: string;
    }>;
  };
}

export interface IAreaResponse {
  data: {
    areaList: Array<{
      id: string;
      areaName: string;
      code: string;
      type: string;
    }>;
  };
}

export interface IDocumentTypeResponse {
  data: {
    documentList: Array<{
      id: number;
      value: string;
    }>;
  };
}

export interface ILevelResponse {
  data: {
    levelList: Array<{
      id: string;
      levelName: string;
    }>;
  };
}

